    private string url
    {
        get
        {
            string urlLink = String.Empty;

            if (_blog.Id < 1)
            {
                urlLink = String.Concat(baseUrl, "/Create").Replace("//", "/");

                return urlLink;
            }
            urlLink = String.Concat(baseUrl, "/Edit/", _blog.Id.ToString()).Replace("//", "/");

            return urlLink;
        }

    }

